import Document, { Html, Head, Main, NextScript } from "next/document";

export default class CustomDocument extends Document {
  render() {
    return (
      <Html>
        <Head>
          <meta content="Description goes here." />
          <title>Seknd</title>
          <link rel="icon" href="/favicon.ico" />
          {/* <link
            rel="stylesheet"
            href="//cdnjs.cloudflare.com/ajax/libs/react-datepicker/2.14.1/react-datepicker.min.css"
          /> */}
          <link
            rel="stylesheet"
            href="react-datepicker/dist/react-datepicker.css"
          />
        </Head>
        <body>
          <Main></Main>
          <NextScript></NextScript>
        </body>
      </Html>
    );
  }
}
